pragma solidity 0.8.7;



import "@openzeppelin/contracts/token/ERC721/ERC721.sol";
import "@openzeppelin/contracts/token/common/ERC2981.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/utils/Counters.sol";
import "./SnakeLib.sol";
import "./ICalculator.sol";

contract Snake is ERC721, ERC2981, Ownable {
    using Counters for Counters.Counter;
    Counters.Counter private tokenSupply;
    
    uint public price = 0.05 ether;
    uint public maxSupply = 10_000;

    string public frontEnd = "TBD";

    ICalculator public calculator = ICalculator(0x93d447D47743E2D4BCAF8bF18e8562d89692CFDe);

    uint CalcOwnerMultiplier = 80; // calculator owners pay 80% of the price; 


    uint96 public royaltyPercentage = 250; // 2.5% in basis points


    mapping(uint => SnakeLib.ColorScheme) internal colorIdToScheme;
    
    mapping(uint => uint) internal idToSchemeIndex;


    

    
    event TokenMint(address purchaser);


    constructor() ERC721("Snake", "SNAKE") {
        // frontEnd = "TBD";
        // maxSupply = 10_000;
        // CalcOwnerMultiplier = 80; // calculator owners pay 80% of the price
        // royaltyPercentage = 250; // 2.5% in basis points
        // price = 0.05 ether;
        // calculator = ICalculator(0x93d447D47743E2D4BCAF8bF18e8562d89692CFDe);
        _setDefaultRoyalty(address(this), 250);

        colorIdToScheme[1] = SnakeLib.ColorScheme(
            "a612de",
            "a612de",
            "a612de",
            "a612de",
            "a612de",
            "EBDEF0",
            "ffe599",
            "27AE60",
            "FF5D3B"
            );
        colorIdToScheme[2] = SnakeLib.ColorScheme(
            "227c9d",
            "227c9d",
            "227c9d",
            "227c9d",
            "227c9d",
            "fef9ef",
            "17c3b2",
            "fe6d73",
            "ffcb77"
            );
        colorIdToScheme[3] = SnakeLib.ColorScheme(
            "2c6e49",
            "4c956c",
            "4c956c",
            "4c956c",
            "4c956c",
            "ffc9b9",
            "fefee3",
            "ffc9b9",
            "4c956c"
            );

        colorIdToScheme[4] = SnakeLib.ColorScheme(
            "0b090a",
            "0b090a",
            "0b090a",
            "0b090a",
            "0b090a",
            "ba181b",
            "b1a7a6",
            "ba181b",
            "0b090a"
            );
        

        colorIdToScheme[5] = SnakeLib.ColorScheme(
            "fee440",
            "fee440",
            "f15bb5",
            "f15bb5",
            "fee440",
            "9b5de5",
            "00f5d4",
            "f15bb5",
            "fee440"
            );

    }

    /**
     * Takes an array of numbers from 1-5
     */

    function buySnake(uint[] memory schemeIds) public payable {
        uint totalMints = schemeIds.length;
        require(msg.value == getFinalPrice(totalMints, msg.sender), "wrong price");
        require(totalMints <= 5 && totalMints > 0, "incorrect number");
        require(tokenSupply.current() + totalMints <= maxSupply, "at limit");

        for(uint i=0; i<totalMints; i++) {
            require(schemeIds[i] > 0 && schemeIds[i]<=5, "color doesn't exist");
            tokenSupply.increment();
            uint256 newItemId = tokenSupply.current();
            idToSchemeIndex[newItemId] = schemeIds[i];
            _safeMint(msg.sender, newItemId);
        }

        emit TokenMint(msg.sender);
    }

    function totalSupply() public view returns(uint supply) {
        supply = tokenSupply.current();
    }

    function getFinalPrice(uint amount, address user) public view returns (uint) {
        uint finalPrice = price * amount;
        if(calculator.balanceOf(user) > 0) {
            finalPrice = (finalPrice * CalcOwnerMultiplier) / 100;
        }

        return finalPrice;

    }




    // function tokenIdsByOwner(address owner) public view returns(uint[] memory) {
    //     uint arrLength = balanceOf(owner);
    //     uint[] memory arr = new uint[](arrLength);
    //     for (uint i=0;i<arrLength; i++) {
    //         arr[i] = tokenOfOwnerByIndex(owner, i);
    //     }
    //     return arr;

    // }

    function tokenURI(uint256 id) public view override returns (string memory) {

        address owner = ownerOf(id);
        require(_exists(id), "does not exist");
        uint schemeIndex = idToSchemeIndex[id];
        SnakeLib.ColorScheme memory scheme = colorIdToScheme[schemeIndex];
        
        SnakeLib.MetaData memory metaData = SnakeLib.MetaData({
            _owner: owner,
            _id: id,
            _schemeIndex: schemeIndex,
            _scheme: scheme,
            _frontEnd: frontEnd
        });

        return SnakeLib.generateTokenURI(metaData);



    }
    

    // OWNER FUNCTIONS
    function withdrawFunds() public onlyOwner {
        uint amount = address(this).balance;
        Address.sendValue(payable(owner()), amount);
    }

    function setFrontEnd(string memory _frontEnd) public onlyOwner {
        frontEnd = _frontEnd;
    }



    // REQUIRED OVERRIDES:
    // function _beforeTokenTransfer(address from, address to, uint256 tokenId)
    //     internal
    //     override(ERC721Enumerable)
    // {
    //     super._beforeTokenTransfer(from, to, tokenId);
    // }

    function supportsInterface(bytes4 interfaceId)
        public
        view
        override(ERC721,ERC2981)
        returns (bool)
    {
        return super.supportsInterface(interfaceId);

    }

    function _burn(uint256 tokenId) internal virtual override {
        super._burn(tokenId);
        _resetTokenRoyalty(tokenId);
    }






}
